import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Toaster } from 'react-hot-toast';

// Импорт компонентов
import Layout from './components/Layout/Layout';
import LoadingSplash from './components/LoadingSplash';
import {
  Dashboard,
  Animals,
  AnimalForm,
  AnimalDetail,
  Feeds,
  FeedForm,
  FeedDetail,
  Comparison,
  Calculator
} from './pages';

function App() {
  const [isLoading, setIsLoading] = useState(true);

  const handleLoadingComplete = () => {
    setIsLoading(false);
  };

  if (isLoading) {
    return <LoadingSplash onLoadingComplete={handleLoadingComplete} />;
  }

  return (
    <div className="App">
      <Router>
        <Layout>
          <Routes>
            {/* Главная страница - Dashboard */}
            <Route path="/" element={<Dashboard />} />

            {/* Животные */}
            <Route path="/animals" element={<Animals />} />
            <Route path="/animals/new" element={<AnimalForm />} />
            <Route path="/animals/:id" element={<AnimalDetail />} />
            <Route path="/animals/:id/edit" element={<AnimalForm />} />

            {/* Корма */}
            <Route path="/feeds" element={<Feeds />} />
            <Route path="/feeds/new" element={<FeedForm />} />
            <Route path="/feeds/:id" element={<FeedDetail />} />
            <Route path="/feeds/:id/edit" element={<FeedForm />} />

            {/* Сравнение и расчеты */}
            <Route path="/comparison" element={<Comparison />} />
            <Route path="/calculator" element={<Calculator />} />

            {/* 404 страница */}
            <Route path="*" element={
              <div style={{
                minHeight: '80vh',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                background: 'rgba(255, 255, 255, 0.1)',
                backdropFilter: 'blur(10px)',
                borderRadius: '20px',
                margin: '2rem'
              }}>
                <div style={{ textAlign: 'center' }}>
                  <div style={{
                    fontSize: '8rem',
                    background: 'var(--primary-gradient)',
                    WebkitBackgroundClip: 'text',
                    WebkitTextFillColor: 'transparent',
                    backgroundClip: 'text',
                    fontWeight: 900,
                    marginBottom: '1rem',
                    animation: 'bounce 2s infinite'
                  }}>
                    404
                  </div>
                  <h1 style={{
                    fontSize: '2rem',
                    fontWeight: 700,
                    color: 'white',
                    marginBottom: '1rem',
                    textShadow: '0 4px 8px rgba(0, 0, 0, 0.3)'
                  }}>
                    Страница не найдена
                  </h1>
                  <p style={{
                    fontSize: '1.2rem',
                    color: 'rgba(255, 255, 255, 0.8)',
                    marginBottom: '2rem',
                    maxWidth: '400px',
                    lineHeight: 1.6
                  }}>
                    Похоже, вы заблудились в лабиринте формул! Давайте вернем вас на главную.
                  </p>
                  <a
                    href="/"
                    className="btn btn-hero animate-pulse"
                    style={{
                      textDecoration: 'none',
                      display: 'inline-block'
                    }}
                  >
                    🏠 Вернуться домой
                  </a>
                </div>
              </div>
            } />
          </Routes>
        </Layout>

        {/* Глобальные уведомления ПРЕМИУМ */}
        <Toaster
          position="top-right"
          toastOptions={{
            duration: 4000,
            style: {
              background: 'linear-gradient(135deg, rgba(255, 255, 255, 0.95) 0%, rgba(255, 255, 255, 0.85) 100%)',
              color: '#1a202c',
              boxShadow: '0 20px 25px rgba(0, 0, 0, 0.15), 0 10px 10px rgba(0, 0, 0, 0.04)',
              border: '1px solid rgba(102, 126, 234, 0.2)',
              borderRadius: '16px',
              backdropFilter: 'blur(20px)',
              fontSize: '0.95rem',
              fontWeight: 500,
              padding: '16px 20px'
            },
            success: {
              duration: 3000,
              style: {
                background: 'linear-gradient(135deg, #4facfe 0%, #00f2fe 100%)',
                color: 'white',
              },
              iconTheme: {
                primary: '#ffffff',
                secondary: '#4facfe',
              },
            },
            error: {
              duration: 5000,
              style: {
                background: 'linear-gradient(135deg, #fa709a 0%, #fee140 100%)',
                color: 'white',
              },
              iconTheme: {
                primary: '#ffffff',
                secondary: '#fa709a',
              },
            },
            loading: {
              style: {
                background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
                color: 'white',
              }
            }
          }}
        />
      </Router>
    </div>
  );
}

export default App;
